import '../App.css';
import React from 'react';
import TextField from '@material-ui/core/TextField';


// TextField Date Component
function RowDate() {
    return (
        <div className="rowDate">
            <label>Date</label>
            <TextField
                className="inputDate"
                id="date"
                type="date"
                defaultValue="2017-05-24"
                InputLabelProps={{
                    shrink: true,
                }}
            />
        </div>
    );
}

export default RowDate;
